var tipuesearch = {"pages": [{'title': 'About', 'text': '小組倉儲: \n https://github.com/40823236/stage3-bg3 \n https://github.com/40823202/stage3-bg3 \n https://github.com/40823203/stage3-bg3 \n https://github.com/40823212/stage3-bg3 \n https://github.com/40823219/stage3-bg3 \n https://github.com/40823222/stage3-bg3 \n https://github.com/40823231-2/stage3-bg3 \n https://github.com/40823244/stage3-bg3 \n 組員: \n 40823202 / 40823202 \n 40823203 / 40823203 \n 40823212 / 40823212 \n 40823219 / 40823219 \n 40823222 / 40823222 \n 40823231 / 40823231 \n 40823236 / 40823236 \n 40823244 / 40823244 \n', 'tags': '', 'url': 'About.html'}, {'title': '每周進度', 'text': '', 'tags': '', 'url': '每周進度.html'}, {'title': 'W9', 'text': '統整組員stage1、stage2的專案。', 'tags': '', 'url': 'W9.html'}, {'title': 'Stage1', 'text': 'bg7 \n 主題:三爪夾頭 \n 原理 夾頭底座的齒條和齒盤導軌嚙合,齒盤的斜面與斜 齒輪嚙合,當斜齒輪轉動時,帶動齒盤轉動,齒盤 背面的導軌也跟著轉動,讓夾頭底座的齒條跟著導 軌向中心移動,進而夾持工件。 \n 繪製零件:40823212 \n 程式模擬:40823236 \n bg12 \n 主題: 鋁罐壓扁機 \n 原理:利用直線運動機構分為精確直線運動機構和近似直線運動機構兩類。其中精確直線運動機構的設計思想主要有兩種：一種是利用幾何中的反演變換，把連杆末端的圓弧路徑反演為直線，用機械反演器可以完成這一功能；另一種則是通過兩個不平行的連杆結構，把路徑限制在兩個平面的交線。近似直線運動機構則是通過多個杆件實現自由度為1的連接，調整杆件的長度使得一點的運動軌跡中包含一段近似直的線段。 \n 繪製零件:40823203 \n 程式模擬:40823202 \n bg19 \n 主題:格鬥機器人 \n 原理:彈射機器人，他的問題是攻擊破壞性低，很難直接將對手擊殺，只能讓對手憑重力下來把自己摔壞或把對手丟進OUT區。彈射主要攻擊方式壓縮氣體沖入汽缸，汽缸快速反應，彈射板才能彈起來 \n 繪製人員:40823219、40823231 \n 程式模擬:40823219、40823231 \n bg22 \n 主題:自動磨豆機 \n 原理 利用輾壓研磨原理，讓咖啡豆在兩塊圓錐鐵中輾壓研磨，錐鐵的距離決定咖啡粉的粗細程度，錐鐵間的距離愈近，粉末愈細；反之，粉末愈粗。 \n 繪製組員:40823244\xa0 \n 程式模擬:40823222\xa0 \n', 'tags': '', 'url': 'Stage1.html'}, {'title': 'Stage2', 'text': 'bg9 \n 主題:蒸汽火車 \n 原理 它是利用燃燒柴油或煤炭等燃料，將鍋爐中的水加熱以產生蒸氣，再由汽缸動力經連桿傳動機構，來推動輪子使車子前進。 \n 繪圖: 40823212 \n 模擬:40823219，40823231、40823236 \n bg10 \n 主題:彈珠軌道 \n 原理:1.運用阿基米得原理，讓彈珠可以沿著一個平面向上移動。 \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa02.運用凸輪原理，使其做一個上下的使其做一個上下的反覆運動，讓彈珠可以像爬階梯一樣。 \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa03.用圓盤的轉動，將球運送至彈珠台(控制圓盤的轉數去查看彈珠的運動軌跡)。 \n 繪圖: 40823202 、40823203 、40823244\xa0 \n 模擬:40823202 、40823222\xa0 \n', 'tags': '', 'url': 'Stage2.html'}, {'title': 'W10', 'text': '', 'tags': '', 'url': 'W10.html'}, {'title': 'task1', 'text': '', 'tags': '', 'url': 'task1.html'}, {'title': 'task2', 'text': '', 'tags': '', 'url': 'task2.html'}, {'title': '零件圖', 'text': '', 'tags': '', 'url': '零件圖.html'}, {'title': '模擬', 'text': '', 'tags': '', 'url': '模擬.html'}, {'title': '影片', 'text': '', 'tags': '', 'url': '影片.html'}]};